    {id:1,name:'mohamed',salaire:3400},
    {id:2,name:'walid',salaire:3700}
  ];

  return(
       <div className='App'>
  
  <h1>loop</h1>
  {friends.map(()=> <h1 key={e.id}>{e.name}</h1>)}
  
           </div>
  );
 }
}

export default App;
